import React, {useEffect, useState} from 'react';

import axios from 'axios';

// const Works = async () => {
//     axios.get('https://the-one-api.dev/v2/book').then(resp => {
//         console.log(resp.data.docs);
//     });
// };

const fetchMovies = async () => {
    const response = await axios.get('https://the-one-api.dev/v2/book')
    return response;
};

const List = () => {
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        fetchMovies().then(resp => setMovies(resp.data.docs));
    }, []);

    return (
        <section>
            {movies.map(movie => {
                return (
                    <div key={movie._id}>{movie.name}</div>
                )
            })}
        </section>
    );
}

const Test = () => {
    return (
            // <Works/>
            <List/>
    );
}

export default Test;
